import React, { useState, useEffect } from "react";

const App = () => {
  const [movie, setMovie] = useState({});

  useEffect(() => {
    const ok = fetch(
      "https://api.themoviedb.org/3/search/movie?api_key=fac34116c639f3e75cd5205251be421c&query=search"
    )
      .then(res => res.json())
      .then(({ data: weather }) => {
        setWeather(weather);
      });
    console.log(ok);
  }, []);

  return <h1></h1>;
};

export default App;
